package icehs.science.chapter04;

public class InDeOperatorTest {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int data=20;
		
		System.out.println(++data);
		System.out.println(data++);
		System.out.println(--data);
		System.out.println(data--);

	}

}
